selector_to_html = {"a[href=\"#permutationer\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.5.1. </span>Permutationer<a class=\"headerlink\" href=\"#permutationer\" title=\"Permalink til denne overskrift\">#</a></h2><p>Permutationer handler om at finde alle de mulige m\u00e5der at s\u00e6tte en sekvens af elementer i en bestemt r\u00e6kkef\u00f8lge. Det centrale her er, at r\u00e6kkef\u00f8lgen af sekvensen er vigtig. Forskellige sekvenser af de samme elementer betragtes alts\u00e5 som forskellige permutationer.</p><p>Antallet af permutationer af <span class=\"math notranslate nohighlight\">\\(n\\)</span> elementer, hvor de alle bruges, er <span class=\"math notranslate nohighlight\">\\(n!\\)</span>. For eksempel, hvis der er fire forskellige b\u00f8ger, og du \u00f8nsker at arrangere dem p\u00e5 en hylde, er der <span class=\"math notranslate nohighlight\">\\(4! = 24\\)</span> mulige m\u00e5der at g\u00f8re dette p\u00e5. N\u00e5r vi placerer b\u00f8gerne p\u00e5 hylden, foretager vi fire valg. Ved det f\u00f8rste valg er der fire muligheder, ved det andet valg er der tre muligheder, ved det tredje er der to muligheder, og ved det sidste er det kun en valgmulighed. Dette f\u00f8lger multiplikationsprincippet og vi f\u00e5r derfor</p>", "a[href=\"#kombinationer\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.5.2. </span>Kombinationer<a class=\"headerlink\" href=\"#kombinationer\" title=\"Permalink til denne overskrift\">#</a></h2><p>Det centrale ved permutationer var, at r\u00e6kkef\u00f8lgen af sekvensen var vigtig. For kombinationer er denne <a class=\"reference internal\" href=\"../../Vaerktoejer/gloser.html#term-redundant\"><span class=\"xref std std-term\">redundant</span></a>. Kombinationer bruges til at bestemme antallet af forskellige m\u00e5der at v\u00e6lge elementer fra en m\u00e6ngde uden at bekymre sig om, i hvilken r\u00e6kkef\u00f8lge de v\u00e6lges.</p><p>For permutationerne af alle fire b\u00f8ger fik vi 24 m\u00e5der at ordne b\u00f8gerne p\u00e5. Alle disse vil v\u00e6re den samme kombination, da r\u00e6kkef\u00f8lgen for <span class=\"math notranslate nohighlight\">\\(ABCD\\)</span> og <span class=\"math notranslate nohighlight\">\\(BACD\\)</span> er ligegyldig. For permutationer af to b\u00f8ger ud af de fire endte vi med 12 m\u00e5der at ordne b\u00f8gerne p\u00e5. Disse vil udg\u00f8re seks kombinationer, da r\u00e6kkef\u00f8lgen for <span class=\"math notranslate nohighlight\">\\(AB\\)</span> og <span class=\"math notranslate nohighlight\">\\(BA\\)</span> er ligegyldig, og disse er derfor den samme kombination. Vi kan ogs\u00e5 opskrive disse:</p>", "a[href=\"../../Del_2/Binomialfordelingen/0binomialfordelingen.html#binomialfordelingen\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">22. </span>Binomialfordelingen<a class=\"headerlink\" href=\"#binomialfordelingen\" title=\"Permalink til denne overskrift\">#</a></h1>", "a[href=\"#pascals-trekant\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.5.2.1. </span>Pascals trekant<a class=\"headerlink\" href=\"#pascals-trekant\" title=\"Permalink til denne overskrift\">#</a></h3><p>\u2026</p>", "a[href=\"#nrpermutationer\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"nrpermutationer\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 13.2 </span></p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(M\\)</span> v\u00e6re en m\u00e6ngde med <span class=\"math notranslate nohighlight\">\\(n\\)</span> distinkte elementer. Antallet af forskellige m\u00e5der at udtage <span class=\"math notranslate nohighlight\">\\(r\\)</span> af de <span class=\"math notranslate nohighlight\">\\(n\\)</span> elementer p\u00e5, hvor <span class=\"math notranslate nohighlight\">\\(r\\leq n\\)</span>,  er</p>\n<div class=\"math notranslate nohighlight\">\n\\[\n    K(n,r) = \\frac{n!}{r!(n-r)!},\n\\]</div>\n<p>hvor <span class=\"math notranslate nohighlight\">\\(K(\\,\\cdot\\, ,\\,\\cdot\\,)\\)</span> er funktionen, der t\u00e6ller antallet af kombinationer.</p>\n</section>\n</div>", "a[href=\"#nnpermutationer\"]": "<div class=\"proof korollar admonition\" id=\"nnpermutationer\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Korollar 13.1 </span></p>\n<section class=\"korollar-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(M\\)</span> v\u00e6re en m\u00e6ngde med <span class=\"math notranslate nohighlight\">\\(n\\)</span> elementer. Antallet af forskellige m\u00e5der at ordne <span class=\"math notranslate nohighlight\">\\(n\\)</span> elementer p\u00e5, er</p>\n<div class=\"math notranslate nohighlight\">\n\\[\n    P(n,n) = n!,\n\\]</div>\n<p>hvor <span class=\"math notranslate nohighlight\">\\(P(\\,\\cdot\\, ,\\,\\cdot\\,)\\)</span> er funktionen, der t\u00e6ller antallet af permutationer.</p>\n</section>\n</div>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.5.3. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2><p>\u2026</p>", "a[href=\"../../Vaerktoejer/gloser.html#term-redundant\"]": "<dt id=\"term-redundant\">redundant</dt><dd><p>N\u00e5r noget er lige gyldigt.</p></dd>", "a[href=\"#kombinationer-og-permutationer\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.5. </span>Kombinationer og permutationer<a class=\"headerlink\" href=\"#kombinationer-og-permutationer\" title=\"Permalink til denne overskrift\">#</a></h1><p>Additions- og multiplikationsprincippet hj\u00e6lper os med at t\u00e6lle antallet af m\u00e5der at v\u00e6lge eller kombinere elementer p\u00e5, fokuserer kombinationer og permutationer p\u00e5 antallet af forskellige m\u00e5der, vi kan arrangere en gruppe elementer p\u00e5.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
